import './App.css';

function App() {
  return (
    <div className="App">
      <navbar className="">
        <h3>V-Meet</h3>
        <div>
          <ul>
            <li>Home</li>
            <li>Meeting</li>
            <li>Add Meeting</li>
          </ul>
        </div>
      </navbar>
      <h1 className='h1-tag'>It's Siddesh Jaiswal Here.</h1>
    </div>
  );
}

export default App;
